Studio  Caballero 
Release Date  12 July 1975  
Category  Classic, Feature, Plot Based
Director  Joseph W. Sarno
Starring  Marie Forsa, Natascha Verell, Eric Edwards, Harry Reems 

A beautiful and erotic classic feature!

Maria leaves the farm and her boyfriend for the bright lights of the big city. On her way, she meets Harry who brings her home to the great distress of his current girlfriend. But Maria soon learns that Harry collects his women like butterflies...
